  \"[{\"type\": \"publication\", \"value\": \"2000-07-15\"}]\"\n\t},\n\t{\n\t\t\"key\":
  \"graphic-preview-description\",\n\t\t\"value\": \"Guzelyali is a small fishing
  harbor on the south shore of Izmit Bay. The harbor is located behind a breakwater.
  According to reports, a leading depression wave was followed by a tsunami overtopping
  the seawall in the back of the harbor, causing small boats to lose their mooring
  lines. When the sea wall was measured, a height of 1.25 m was obtained for the tsunami.
  The entire harbor was covered with a 2.5 cm to 15 cm (1-6 inch) thick layer of oil
  that may have come from the large refinery fire across Izmit Bay.A tsunami flooded
  this collapsed building east of Guzelyali. Subsidence along the shoreline made the
  piers and moorings unsafe. Tsunami data collectors had to approach the shore by
  boat to take measurements of tsunami runup. Partially submerged trees are visible
  in the left background.\"\n\t},\n\t{\n\t\t\"key\": \"frequency-of-update\",\n\t\t\"value\":
